function MoNavFade() {
  $('#mo_nav').fadeToggle(100);

  if ($('#nav-icon3').attr('class') == 'mo') {
    $('html, body').css({
      'overflow-y': 'hidden',
      'height': '100%'
    });
  } else {
    $('html, body').css({
      'overflow-y': 'scroll',
      'height': 'auto'
    });
  }

  $('#nav-icon3').toggleClass('open');
}

function InsertData() {
  var reqName = document.getElementById('reqname');
  var reqStandard = document.getElementById('reqstandard');
  var reqPhone = document.getElementById('reqphone');
  var reqMemo = document.getElementById('reqmemo');
  var Data = {
    reqName: reqName.value,
    reqStandard: reqStandard.value,
    reqPhone: reqPhone.value,
    reqMemo: reqMemo.value
  };
  var baseURI = 'api/insert_consul.php';
  axios.post("".concat(baseURI), {
    Data: Data
  }).then(function (result) {
    console.log(result);

    if (result.data.phpResult == 'ok') {
      alert('상담신청완료');
    }
  }).catch(function (err) {
    return console.log('Login: ', err);
  });
}

LinkCheck = function LinkCheck() {
  //Get QueryString
  params = {};
  window.location.search.replace(/[?&]+([^=&]+)=([^&]*)/gi, function (str, key, value) {
    params[key] = value;
  });
  var paramsSection = params.section;

  if (paramsSection != undefined) {
    var jb = $('.con' + paramsSection).offset();
    console.log(jb);
    $('html, body').animate({
      scrollTop: jb.top-150
    },00);
  } 

  return params;
};

LinkCheck();